  \"Thermal Protection System Materials (TPSM): Conformal Ablative TPS (CA-TPS) Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 13,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:25:18.171707\",\n\t\"name\": \"thermal-protection-system-materials-tpsm-conformal-ablative-tps-ca-tps-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;CA-TPS is leveraging earlier investments
  made by ARMD&amp;rsquo;s Hypersonic and HEOMD&amp;rsquo;s ETDD program that matured
  the concept from TRL 1 to 2.CA-TPS starts with thick, carbonized rayon felt and
  the flexible felt is converted to ablative TPS via low density phenolic resin infusion
  similar to the PICA process.&amp;nbsp; The resulting conformal TPS molded to the
  required shape prior to resin infusion can then be machined and bonded to the carrier
  structure.&amp;nbsp; The ease of machining holes to accommodate protrusion on the
  heat shield or back shell is an attractive feature.&amp;nbsp; The material can be
  machined with exceptional tolerance and compliance which allows TPS integration
  with extremely simple seams to form a robust system. The design should result in
  much larger molded TPS panels that can be directly bonded to most carrier structures
  and allow for a simplified design of seams between gore panels.&amp;nbsp; This will
  eliminate the need for gap filler design and strain isolation pads, and should accommodate
  a wider range of allowable carrier structure imperfections when compared to a rigid
  material such as PICA.&lt;/p&gt;\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
